import React from "react";
import style from "./About.module.css";

const About = () => {
  return (
    <div>
      <div
        className={`${style.aboutArea} ${style.section} ${style.paddingTop}`}
      >
        <div className={style.container}>
          <div className={style.sectiontitle}></div>
        </div>
      </div>
    </div>
  );
};

export default About;
